import React, { useState } from "react";
import DBoardTemplate from "./DBoardTemplate";
import { Grid, Menu, Segment } from "semantic-ui-react";

const content = (
  <Grid>
    <Grid.Column width={4}>
      <Menu fluid vertical tabular>
        <Menu.Item name="bio" onClick={this.handleItemClick} />
        <Menu.Item name="pics" />
        <Menu.Item name="companies" />
        <Menu.Item name="links" />
      </Menu>
    </Grid.Column>

    <Grid.Column stretched width={12}>
      <Segment>
        This is an stretched grid column. This segment will always match the tab
        height
      </Segment>
    </Grid.Column>
  </Grid>
);

const AdvocateDBoard = () => {
  const [activeItem, setActiveItem] = useState("overview");

  const handleItemClick = (e, { name }) => this.setState({ activeItem: name });

  return (
    <div>
      <DBoardTemplate content={content} />
    </div>
  );
};

export default AdvocateDBoard;
